const Stats = () => {

    useEffect( async() => {
        const data = await fetch("https://docs.google.com/forms/d/1owSisXNYsouTrS-EWhVQ1WfzN0mZroaOY2wKZOtvKYk/edit#responses");
        console.log(data);
    }, [])

    /*
